import React, { useEffect, useRef, useState } from "react";
import { motion } from "framer-motion";

export default function SkillsSection() {
  const [inView, setInView] = useState(false);
  const ref = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setInView(true);
        }
      },
      { threshold: 0.2 }
    );

    if (ref.current) {
      observer.observe(ref.current);
    }

    return () => {
      if (ref.current) {
        observer.unobserve(ref.current);
      }
    };
  }, []);

  const skillCategories = [
    {
      category: "Análisis de Datos",
      color: "#007BFF",
      skills: [
        { name: "Python", level: 95 },
        { name: "R", level: 85 },
        { name: "SQL", level: 90 },
        { name: "Excel Avanzado", level: 95 },
        { name: "Pandas", level: 90 },
        { name: "Matplotlib", level: 85 },
        { name: "Plotly", level: 85 },
      ],
    },
    {
      category: "IA & Automatización",
      color: "#00C896",
      skills: [
        { name: "GPT Agents", level: 90 },
        { name: "N8N", level: 85 },
        { name: "Power Automate", level: 80 },
        { name: "Microsoft Fabric", level: 75 },
        { name: "scikit-learn", level: 85 },
      ],
    },
    {
      category: "Gestión de Proyectos",
      color: "#007BFF",
      skills: [
        { name: "Monday", level: 90 },
        { name: "ClickUp", level: 85 },
        { name: "KanbanFlow", level: 85 },
      ],
    },
    {
      category: "Lead Generation",
      color: "#00C896",
      skills: [
        { name: "HubSpot", level: 85 },
        { name: "Sales Navigator", level: 90 },
        { name: "Apollo", level: 85 },
        { name: "Similarweb", level: 80 },
        { name: "Datagma", level: 80 },
      ],
    },
  ];

  return (
    <section id="skills" className="py-24 bg-[#FAFAF9]">
      <div className="max-w-7xl mx-auto px-6">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-[#222222] mb-4">
            Habilidades <span className="gradient-text">Técnicas</span>
          </h2>
          <div className="w-20 h-1 bg-gradient-to-r from-[#007BFF] to-[#00C896] mx-auto rounded-full" />
        </motion.div>

        <div className="grid md:grid-cols-2 gap-8">
          {skillCategories.map((category, categoryIndex) => (
            <motion.div
              key={categoryIndex}
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.6, delay: categoryIndex * 0.15 }}
              className="bg-white p-8 rounded-2xl shadow-lg hover:shadow-2xl transition-all"
            >
              <h3
                className="text-2xl font-bold mb-6"
                style={{ color: category.color }}
              >
                {category.category}
              </h3>
              <div className="space-y-5">
                {category.skills.map((skill, skillIndex) => (
                  <motion.div
                    key={skillIndex}
                    initial={{ opacity: 0, x: -20 }}
                    animate={inView ? { opacity: 1, x: 0 } : {}}
                    transition={{
                      duration: 0.5,
                      delay: categoryIndex * 0.15 + skillIndex * 0.05,
                    }}
                  >
                    <div className="flex justify-between mb-2">
                      <span className="font-medium text-[#222222]">
                        {skill.name}
                      </span>
                      <span className="text-sm text-gray-500">{skill.level}%</span>
                    </div>
                    <div className="h-2 bg-gray-200 rounded-full overflow-hidden">
                      <motion.div
                        initial={{ width: 0 }}
                        animate={inView ? { width: `${skill.level}%` } : {}}
                        transition={{
                          duration: 1,
                          delay: categoryIndex * 0.15 + skillIndex * 0.05 + 0.3,
                          ease: "easeOut",
                        }}
                        className="h-full rounded-full"
                        style={{
                          background: `linear-gradient(90deg, ${category.color} 0%, ${
                            category.color === "#007BFF" ? "#00C896" : "#007BFF"
                          } 100%)`,
                        }}
                      />
                    </div>
                  </motion.div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
}
